import Card from "../UI/Card";

function AddUsers(props) {
  return (
    <Card>
      <form>
        <label>Username</label>
        <input />
        <br />
        <label>Age(Years)</label>
        <input />
      </form>
    </Card>
  );
}

export default AddUsers;
